After overtrading yesterday I wanted to step back and just analyze today. 

Gonna be a long post but wanted to break down some trading techniques today based on price action.

Price action in the simplest terms is how a stock reacts and trends around certain price levels. 

These examples are on Tesla

Setup #1
First setup comes at the $403 level. You can see by the red line that on market open (where the chart turns from grey to black) it bounces. And actually if you continue that red line to the left you can see that $403 was a resistance level too in pre market. Playing with direction, the market was selling off and then comes back to the $403 level. You could enter here going short with minimal risk and sell if it breaks and holds above $403. Price was under EMA (blue line) here and red on MACD (bars at bottom of chart) which are supporting signs of a good short position here

#2
$400 is a key long term support/resistance level. You can see that it kept trying to break but failed. Again playing with overall market direction on the day, you could go short here with minimal risk by just cutting if it break and holds above $400. MACD was also showing signs of reduced strength. 

#3
Second red line represents a support around $388. You can see this level was tested twice before recovering. However this time around there are red bars that broke and held under. This shows signs of a weakening support. This offers another opp to go short with minimal risk placing a stop around the $390 level. 

#4
Continuing the $388 support/resistance level, you see it getting rejected. Note: a support becomes a resistance once price goes under. You could buy right at the $388 level, cutting losses if it breaks to $390 with potential gains of $8 to the $380 level or $16 to the low of 372. This is a $2 risk to $16 reward or a 1:8 risk to reward ratio.

You always want the amount of risk to be minimal while the amount of reward to be high. 

Price action is just one tool you can use. There are so many different ways to trade but the key is to find one that makes sense to you. 

Hopefully this helps and hope everyone has a great labor day weekend!";}i:121;a:1:{s:14:"comments_count";i:0;}i:122;a:1:{s:11:"likes_count";i:0;}i:123;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuOHOxsZh6";}i:124;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118768084_2666040736996996_2266047637062249197_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=104&_nc_ohc=5koKeCmzRzkAX-Tmu5B&_nc_tp=18&oh=7a40f6046a64280d62137314b0c25343&oe=5F7C9B56";}i:125;a:1:{s:4:"type";s:7:"sidecar";}i:126;a:1:{s:8:"owner_id";i:38163977296;}i:127;a:1:{s:14:"owner_username";s:0:"";}i:128;a:1:{s:14:"owner_fullname";s:0:"";}i:129;a:1:{s:9:"owner_pic";s:0:"";}i:130;a:1:{s:2:"id";s:19:"2390910508989923112";}i:131;a:1:{s:10:"short_code";s:11:"CEuOHC6F78o";}i:132;a:1:{s:12:"created_time";i:1599238764;}i:133;a:1:{s:7:"caption";s:1070:"Con un fuerte enfasis en el desarrollo de habilidades para la vida laboral, @universityofstirling no solo te ayudarÃ¡ a tener Ã©xito acadÃ©mico, sino que te prepararÃ¡ para tu carrera.
